import React, { Component } from 'react';


class LogIn extends Component {

  constructor(props) {
    super(props);
    this.state = {
      email: ''
    }
  }

  render() {
    return (
      <React.Fragment>
        <label>Log In</label>
        <input
          type="text"
          name="email"
          value=''
        />
      </React.Fragment>
    )
  }
}

export default LogIn;
